package com.sugon.analysis.domain.data.object.oracle;import lombok.Data;import javax.persistence.Column;import javax.persistence.Entity;import javax.persistence.Id;import javax.persistence.Table;import java.util.Date;/** * @author: create by huangxb * @version: v1.0 * @description: * @date:2019/10/10 */@Data@Entity@Table(name = "T_EDUCATION_INFO",schema = "NJGAZNL")public class TEducationDo {    /**     * ID     */    @Id    @Column(name = "ID")    private String id;    /**     * 教育类别     */    @Column(name = "CATEGORIES_OF_EDUCATION")    private String categoriesOfEducation;    /**     * 学历名称     */    @Column(name = "EDUCATIONAL_TITLE")    private String educationalTitle;    /**     * 入学时间     */    @Column(name = "ENROLLMENT_TIME")    private Date enrollmentTime;    /**     * 毕业日期     */    @Column(name = "GRADUATION_DATE")    private Date graduationDate;    /**     * 所学专业名称     */    @Column(name = "PROFESSIONAL_NAME")    private String peofessionalName;    /**     * 学校名称     */    @Column(name = "SCHOOL_NAME")    private String schoolName;    /**     * 数据来源     */    @Column(name = "DATA_SOURCE")    private String dataSource;    /**     * 数据来源ID     */    @Column(name = "DATA_SOURCE_ID")    private String dataSourceId;    /**     * 身份证号码     */    @Column(name = "IDNO")    private String idNo;    /**     * 0正常 1删除     */    @Column(name = "DELSTATUS")    private int delStatus;    /**     * 学位     */    @Column(name = "DEGREE")    private String degree;    /**     * 政法院校标识     */    @Column(name = "LAW_MARK")    private String lawMark;}